    false,nt"url": null,nt"notes": "This annual narrative report for Innoko
    NWR outlines Refuge accomplishments during the 1981 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan.
    Refuge administration is outlined; information about personnel, manpower programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, grasslands, grazing, haying, fire
    management, pest control, water rights, and wilderness areas. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, and fisheries resources.
    Cooperative programs and items of interest are provided at the end.",nt"owner_org":
